import React from 'react';
import { Container, CardDeck, Card } from 'react-bootstrap';

const Portfolio = () => {
  return (
    <Container>
      <h1>My Projects</h1>
      <CardDeck>
        {/* Repeat this Card for every project */}
        <Card>
          <Card.Img variant="top" src="/path-to-your-project-image.jpg" />
          <Card.Body>
            <Card.Title>Project Title</Card.Title>
            <Card.Text>Short project description...</Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">
              <a href="/link-to-deployed-application">Deployed Application</a> | 
              <a href="/link-to-github-repository">Github Repository</a>
            </small>
          </Card.Footer>
        </Card>
      </CardDeck>
    </Container>
  );
};

export default Portfolio;
